import React,{Component} from 'react';
import axios from 'axios';

class Blog extends Component {
    componentDidMount(){    
        axios.get('https://jsonplaceholder.typicode.com/posts')
             .then(response=>{
                 console.log(response);
             })
    }

    render(){
        return (
            <div></div>
        )
    }
}

export default  Blog;
